import { darkTheme } from '../theme';
import { AppBar, Toolbar, Typography, Button, IconButton, makeStyles, Link } from '@material-ui/core';
import MenuIcon from '@material-ui/icons/Menu';

const useStyles = makeStyles({
    // menuButton: {
    //   marginRight: darkTheme.spacing(2),
    // },

    title: {
      flexGrow: 1,
    },
  })

const Navbar = () => {
    const classes = useStyles();

    return (
        <AppBar position="static" position="fixed">
            <Toolbar>
                <Button component={Link} href="#home">home</Button>
                <Button component={Link} href="#aboutMe">aboutMe</Button>
                <IconButton edge="end" className={classes.menuButton}>
                    <MenuIcon />
                </IconButton>
            </Toolbar>
        </AppBar>
    )
}

export default Navbar
